import './header.css';
import {usePages} from "../../hooks/usePages/Usepages";

import {
    BrowserRouter as Router, 
    Link,
  } from "react-router-dom";


function HeaderMain() {
    
    const {isOrganizationPage,
        isOrganizationList,
        ischargetpointPage,
        ischargetpointList,
        isLoginPage,
        isHome,gotolist,gotolistcharget}= usePages();

    const searchHandler = (e) =>{
        if(e.key === 'Enter'){
            const search = e.target.value;
            gotolist(search);
        }

    }

    const searchHandlercharget = (e) =>{
        if(e.key === 'Enter'){
            const search = e.target.value;
            gotolistcharget(search);
        }

    }

    return (
        <div className="header just_AR">
            
            {isHome && (<h1>HOME</h1>)}
            {isOrganizationPage && (<h1>ORGANIZATION</h1>)} 
            {isLoginPage && (<h1>LOGIN PAGE</h1>)} 
            {isOrganizationList && (<h1>LIST ORGANIZATION</h1>)} 
            {isOrganizationList && (<input type="text" placeholder="search" onKeyPress={searchHandler}></input>)}
            {isOrganizationPage && (<button onClick={e=>gotolist()}>Back</button>)} 
            {isOrganizationList && (<Link to="/organization/new"><p>Create</p></Link>)} 
            {ischargetpointPage && (<h1>CHARGETPOINT</h1>)} 
            {ischargetpointList && (<h1>LIST CHARGETPOINT</h1>)} 
            {ischargetpointList && (<input type="text" placeholder="search" onKeyPress={searchHandlercharget}></input>)}
            {ischargetpointPage && (<button onClick={e=>gotolistcharget()}>Back</button>)} 
            {ischargetpointList && (<Link to="/chargetpoint/new"><p>Create</p></Link>)} 
             
        </div>
    );
}



export default HeaderMain;
